import React from 'react';

import './App.css';
import Display from './components/display';

class App extends React.Component{
  state=[

    {name:'pal',age:'12',job:'div'},
    {name : 'pal',age:'12',job:'div'}
  ]

  render(){
  return (
    <div className="App">
      <Display name={this.state[0].name} age={this.state[0].age} job={this.state[0].job}></Display>
      <Display name={this.state[1].name} age={this.state[1].age} job={this.state[1].job}></Display>

    </div>
  );
}
}

export default App;
